"   </div>",
"   <div class=\"lgnd\">",
"    The photograph is from a snoring patient in whom obstructive sleep apnea was excluded by polysomnography. Erythema and edema of the uvula are present, probably secondary to the tissue vibration that accompanies the snoring sound.",
