var title_f32_60_33739="NNRTIs PI";
var content_f32_60_33739=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PI%2F74973&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PI%2F74973&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Non-nucleoside reverse transcriptase inhibitors (NNRTIs)",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <colgroup width=\"20%\">",
"     </colgroup>",
"     <colgroup span=\"2\" width=\"40%\">",
"     </colgroup>",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Drug name",
"       </td>",
"       <td class=\"subtitle1\">",
"        Dosing instructions",
"       </td>",
"       <td class=\"subtitle1\">",
"        Side effects &amp; interactions",
"       </td>",
"      </tr>",
"      <tr class=\"divider_bottom\">",
"       <td>",
"        Efavirenz (Sustiva&reg;)",
"       </td>",
"       <td>",
"        Take first dose on weekend (to ensure tolerable when not working), usually recommended once per day at bedtime. Should be taken on an empty stomach (one hour before or two hours after eating).",
"       </td>",
"       <td>",
"        May need to avoid driving or work for first few days due to dizziness or \"hung over\" feeling. May cause depression, anxiety, nightmares, or vivid dreams. Must avoid pregnancy. Interacts with many medications. Avoid St. John's wort. May cause depression that responds well to a medication change, but it takes weeks for the full effects to wear off.",
"       </td>",
"      </tr>",
"      <tr class=\"divider_bottom\">",
"       <td>",
"        Nevirapine (Viramune&reg;)",
"       </td>",
"       <td>",
"        Usually taken once per day for first 14 days, then twice daily. Take with or without food.",
"       </td>",
"       <td>",
"        Skin rash is most common side effect. Can cause liver problems, especially during the first 12 weeks.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Rilpivirine (Edurant&reg;)",
"       </td>",
"       <td>",
"        Take one tablet daily with a meal. Must avoid concurrent use of drugs that reduce stomach acid.",
"       </td>",
"       <td>",
"        May cause depression, but this is less common and less severe compared with efavirenz (Sustiva&reg;, Atripla&reg;).",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    The information contained in this table is a supplement to the standard educational brochures your pharmacy provides. The information in these tables highlights a few issues, but is not all-inclusive. Read the complete information provided to you by your pharmacy and/or healthcare provider.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
